import {React, useContext} from 'react';
import UserProfileContext from '../../context/user-profile/user-profile.context';
import ProfileDisplayContext from '../../context/profile-display/profile-display.context';
import {ProfileIconContainer} from './profile-icon.styles';

const ProfileIcon = () => {
    const {toggleHidden} = useContext(ProfileDisplayContext);
    const {displayIcon} = useContext(UserProfileContext);

    return <ProfileIconContainer onclick={toggleHidden}>{displayIcon}</ProfileIconContainer>
}

export default ProfileIcon;
